import React from "react";
import "./welcome.css";
import rocketman from '../assets/img/rocketman.png'

function Welcome() {
  return (
    <div>
      <h1 className="welcome-text">Welcome Rocketeer !</h1>
      <button className="welcome-button">Start Questionnaire</button>
      <p className="welcome-submitted">Submitted Applications</p>
      <div className="welcome-img">
      <img src={rocketman} />
      </div>
    </div>
  );
}

export default Welcome;
